export default class TopInfo extends Component {
  isEmpty(obj) {
    return Object.keys(obj).length === 0;
  }

  render() {
    const {
      id,
      name
    } = this.props.game;
    console.log(this.isEmpty(this.props.game));

    if(this.isEmpty(this.props.game)) {
      return <loading_spinner />
    }

    return (
      <Col lg={{ span: 9, offset: 1 }}>
        <Row className="pb-3">
          <Col>
            <h5>Developer</h5>
            {/* <p>{props.game.developers[0].name}</p> */}
          </Col>
          <Col>
            <h5>Publisher</h5>
            {/* <p>
                    {props.game !== undefined
