                      : ''}
                  </p> */}
          </Col>
          <Col>
            <h5>Available</h5>
            {/* <p>
                    {props.game !== undefined
                      ? props.game.released
                      : ''}
                  </p> */}
          </Col>
        </Row>
        <Row>
          <Col>
            <h5>Metacritic</h5>
            {/* <p>
                    {props.game !== undefined
                      ? props.game.metacritic
                      : ''}
                  </p> */}
          </Col>
          <Col>
            <h5>Rating</h5>
            {/* <p>
                    {props.game !== undefined
                      ? props.game.rating
                      : ''}
                  </p> */}
          </Col>
          <Col>
            <h5>Platform</h5>
          </Col>
        </Row>
      </Col>
    );
  }
}
